import React from 'react';

const Header = () => {
    return (
        <header>
            <h1>Rupash Pudasaini</h1>
            <p>Software Developer</p>
            <p>Phone: 623-845-2971 </p>
            <p>Email: <a href="mailto:Rupash2006@gmail.com">Rupash2006@gmail.com</a></p>
            <p>Location: Phoenix, AZ</p>
            <p>LinkedIn: <a href="https://www.linkedin.com/in/rupashpudasaini/" target="_blank" rel="noopener noreferrer">rupashpudasaini</a></p>
        </header>
    );
}

export default Header;
